class Solution {
    func maximumSum(_ nums: [Int]) -> Int {
        var dp = [Int: Int]()
        var res = 0
        for num in nums {
            var prod = 1
            var n = num
            for i in 2...Int(sqrt(Double(num))) + 1 {
                if n % i == 0 {
                    var count = 0
                    while n % i == 0 {
                        n /= i
                        count += 1
                    }
                    if count % 2 != 0 { prod *= i }
                }
            }
            if n > 1 { prod *= n }
            dp[prod, default: 0] += num
            res = max(res, dp[prod]!)
        }
        return res
    }
}
